import React from 'react';
import './SignButton.css';
import { Link } from 'react-router-dom';
import { useNavigate } from "react-router-dom";



function SignButton(props) {
    const history = useNavigate();
    return (
        props.withIcon ?
            <div className='SignButton' onClick={()=>history.push(`/Home`)}>
                <img src = {props.icon}/>
                {props.message}
            </div>
            :
        props.signin!==1?
            <div className='SignButton-Email' onClick={()=>history.push(`/Home`)}>
                {props.message}
            </div>
            :
            <div className='Signin-already' onClick={()=>history.push(`/Home`)}>
                {props.message}
            </div>



    )
}

export default SignButton
